// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

/// @title Search Manager 
/// @author Roberth Garcia.
/// @notice smart contract for search workflow management.
contract DicioAlliacePoc{

    error SearchAlReadyExistError(string _uuid);
    error SearchNotExistError(string _uuid);
    error SearchCompletedError(string _uuid);

    event OwnershipTransferred(address previousOwner, address newOwner);    
    event CreatedSearchEvent(address owner, string uuid, string cid);
    event BroadcastEvent(address owner, string uuid, string cid, string curp);
    event ParticipateEvent(address participant, string uuid, string cid, uint id);
    event BroadcastEndingEvent(string uuid);
    event SetScoreEvent(string uuid, string cid);

    modifier onlyOwner(){
        require(ownerContract == msg.sender, "not owner");
        _;
    }    

    address public ownerContract;
    uint public quorum;

    enum State { Broadcast, Completed, Score }

    struct Search {
        address owner;
        string uuid;
        string curp;
        string cid;
        string score;
        uint createBroadcast;
        uint endBroadcast;
        uint endDate;
        State state;        
    }    

    struct Record {
        address participant;        
        string cid;  
        uint recordDate;        
    }

    mapping (bytes32 => Search) private searchs;    
    mapping (bytes32 => uint)  private counterForRecords;    
    mapping (bytes32 => mapping(uint => Record)) private recordsBySearchs;

    constructor(){
        ownerContract = msg.sender;
        quorum = 2;
    }

    function setOwner(address _newOwner)
        external 
        onlyOwner
    {
        require(_newOwner != address(0), "invalid address");        

        address oldOwner = ownerContract;        
        ownerContract = _newOwner;

        emit OwnershipTransferred(oldOwner, _newOwner);        
    }

    function ChangeQuorum( uint _quorum)
        public         
        onlyOwner
        returns( bool )
    {
        quorum = _quorum;
        return true;
    }
    function DetailSearch( string memory _uuid) 
        public
        view
        returns ( 
            address owner,
            string memory uuid,
            string memory curp,
            string memory cid,
            string memory score,
            uint createBroadcast,
            uint endBroadcast,            
            State state, 
            uint records,
            uint endDate
        )
    {
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid));
        records = counterForRecords[uuidTx];
        Search memory data = searchs[uuidTx];

        owner = data.owner; 
        uuid = data.uuid;
        curp = data.curp;
        cid = data.cid;
        score = data.score;
        createBroadcast = data.createBroadcast;
        state = data.state;
        endBroadcast = data.endBroadcast;        
        endDate = data.endDate;


    }

    function CreateSearch(string memory _uuid, string memory _curp, string memory _cid)                 
        public 
        returns(bool)
    {         
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid));

        // Valida que no exista en las busquedas 
        if(searchs[uuidTx].createBroadcast > 0) {
            revert SearchAlReadyExistError(_uuid);
        }

        // Agrega la busqueda
        searchs[uuidTx] = Search({
            owner: msg.sender,            
            uuid: _uuid,
            curp: _curp,
            cid: _cid,
            score: "",
            createBroadcast: block.timestamp,            
            endBroadcast: 0,            
            endDate: 0,
            state: State.Broadcast
        });

        emit CreatedSearchEvent(msg.sender, _uuid, _cid);      

        ( bool ok ) = BroadCastSearch(_uuid);

        searchs[uuidTx].state = State.Broadcast;      

        return ok;

    }
    function BroadCastSearch(string memory _uuid)         
        private 
        returns(bool)
    {
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid));

        Search storage item = searchs[uuidTx];

        item.state = State.Broadcast;

        //Implementar logica para llamar a otro smart Contract
        emit BroadcastEvent(msg.sender, item.uuid, item.cid, item.curp);

        return true;
    }

    function Participate(string memory _uuid, string memory _cid) 
        public 
        returns(uint idRecord)
    {   
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid));        

        // Valida que exista en las busquedas 
        if(searchs[uuidTx].createBroadcast == 0) {
            revert SearchNotExistError(_uuid);
        }
        // Valida que no este cerrado el broadcast
        if(searchs[uuidTx].state == State.Completed) {
            revert SearchCompletedError(_uuid);
        }        

        counterForRecords[uuidTx]++;
        idRecord = counterForRecords[uuidTx];      

        recordsBySearchs[uuidTx][idRecord] = Record({
            participant: msg.sender,
            cid: _cid,
            recordDate: block.timestamp
        });

        emit ParticipateEvent(msg.sender, _uuid, _cid, idRecord);

        if(counterForRecords[uuidTx] >= quorum)
        {
            CloseBroadcast(_uuid);            
        }       
    }

    function DetailParticipation(string memory _uuid, uint id)
        public
        view
        returns (
            address participant,
            string memory cid, 
            uint recordDate
        )
    {
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid));

        // Valida exista la busqueda.  
        if(searchs[uuidTx].createBroadcast == 0) {
            revert SearchNotExistError(_uuid);
        }

        Record memory item =  recordsBySearchs[uuidTx][id];

        return( 
            item.participant,
            item.cid,
            item.recordDate
        );
    }

    function CloseBroadcast(string memory _uuid)         
        private 
        returns(bool)
    {
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid)); 
        Search storage item = searchs[uuidTx];

        item.state = State.Completed;        
        item.endDate = block.timestamp;

        emit BroadcastEndingEvent(_uuid);

        return true;
    }

    function SetScore(string memory _uuid, string memory _cid)
        public         
    {
        bytes32 uuidTx = keccak256(abi.encodePacked(_uuid)); 

        // Valida exista la busqueda.  
        if(searchs[uuidTx].createBroadcast == 0) {
            revert SearchNotExistError(_uuid);
        }
        // Valida el status. Deberia de ser completada
        if(searchs[uuidTx].state == State.Completed) {
            revert SearchCompletedError(_uuid);
        }

        Search storage item = searchs[uuidTx];

        item.score = _cid;
        item.state = State.Score;        
        item.endDate = block.timestamp;

        emit SetScoreEvent(_uuid, _cid);
    }
}

